import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

const baseUrl = "https://pokeapi.co/api/v2/pokemon";

function App() {
  const [data, setData] = useState([]);

  const axiosUrl = async () => {
    const dats = await axios.get(baseUrl + "/");
    setData(dats.data.results);
    console.log(data);
  };

  useEffect(() => {
    axiosUrl();
  }, []);

  return (
    <div className="App">
      {data.map((res) => {
        return <span>{res.name}</span>;
      })}
    </div>
  );
}

export default App;
